<?phpnamespace Winged\Model;class Pais extends Model{    public function __construct()    {        parent::__construct();        return $this;    }    /** @var $id_pais integer */    public $id_pais;    /** @var $pais string */    public $pais;    /** @var $sigla string */    public $sigla;    public static function tableName()    {        return "pais";    }        public static function primaryKeyName()    {        return "id_pais";    }        public function primaryKey($pk = false)    {        if($pk && (is_int($pk) || intval($pk) != 0)){            $this->id_pais = $pk;            return $this;        }        return $this->id_pais;    }        public function behaviors()    {        return [];    }        public function reverseBehaviors()    {        return [];    }        public function labels()    {        return [];    }        public function rules()    {        return [];    }}